 const {data,loading,error} =   useFetch(`https://api.test.datacite.org/dois?query=prefix:10.5517`);

 const formatData = (data: any): StructuralData[] => 
 {
     const arr:StructuralData[] =  data.map((val:any) => {
      return { title: val.attributes.titles[0], id: val.id }
     })
     return arr;
 }



  const List = (data:any[]) => {
    if (!data || ! data.data || data.length === 0) return <p>No Data, sorry</p>;
    return (
      <ul>
        <h2 className='list-head'>Available Public Repositories</h2>
        {data.map((dataVal) => {
          return (
            <li key={dataVal.id} className='list'>
              <span className='repo-text'>{repo.name} </span>
              <span className='repo-description'>{repo.description}</span>
            </li>
          );
        })}
      </ul>
    );
  };



    return (
        <Aux>
            Data
            {listData(data)};
        </Aux>
        )
}
